import React, { useEffect, useState} from 'react';
import {Link} from "react-router-dom";
import {GetPrizivnik} from "../context/provider";


function FullPriziv() {



    return (
        <div>
            <Link to="/priziv">Призывники</Link> / <Link to={`/${fullpriziv.surname}`}>{fullpriziv.surname}</Link>
            <br/>
            <img src={require('../fotki/1.png')} width="240" height="255"/>
            {GetPrizivnik() ?.map(prizivnik =>
                            <div key={prizivnik.id}>
                            <div className={"name"}><a>Фамилия:</a> {prizivnik.surname}</div>
                            <div className={"name"}><a>Имя:</a> {prizivnik.name}</div>
                            <div className={"name"}><a>Отчество:</a> {prizivnik.patronymic}</div>
                            <div className={"name"}><a>Категория:</a> {prizivnik.categoriya}</div>
                            <div className={"name"}><a>Возраст:</a> {prizivnik.vozrast}</div>
                            <div className={"name"}><a>Наличие отсрочки:</a> {prizivnik.otsrochka}</div>
                            <div className={"name"}><a>Адрес:</a> {prizivnik.adress}</div>
                            )}
                            </div>)}
        </div>
    );
}

export default FullPriziv;
